            // Make avatar picture boxes circular
            MakePictureBoxCircular(avatarPictureBox1);
            MakePictureBoxCircular(avatarPictureBox2);
            MakePictureBoxCircular(avatarPictureBox3);
            MakePictureBoxCircular(avatarPictureBox4);
            MakePictureBoxCircular(avatarPictureBox5);
            MakePictureBoxCircular(avatarPictureBox6);

            // Add hover effects to transaction panels
            AddHoverEffect(transactionPanel1);
            AddHoverEffect(transactionPanel2);
            AddHoverEffect(transactionPanel3);
            AddHoverEffect(transactionPanel4);
            AddHoverEffect(transactionPanel5);
            AddHoverEffect(transactionPanel6);
        }

        private void MakePictureBoxCircular(PictureBox pb)
        {
            System.Drawing.Drawing2D.GraphicsPath path = new System.Drawing.Drawing2D.GraphicsPath();
            path.AddEllipse(0, 0, pb.Width, pb.Height);
            pb.Region = new Region(path);
        }

        private void AddHoverEffect(Panel panel)
        {
            panel.MouseEnter += (sender, e) => {
                panel.BackColor = Color.FromArgb(245, 245, 245);
            };

            panel.MouseLeave += (sender, e) => {
                panel.BackColor = Color.White;
            };
        }

